import * as React from 'react';

interface Props {
    title: string;
}

const myStyle = {
    color: '#0000FF'
};

export const SideBarHeader: React.FC<Props> = () => {
    return (
        <h3 style={myStyle}>
            Props.title
        </h3>
    );
};
